import React from "react";
import "./App.css";

import Header from "./components/header";
import Body from "./components/body";

import headerInfo from "./textInfo";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = { navItems: headerInfo, activeId: 1 };
  }

  setHeader = (data) => {
    console.log("APP");
    console.log(data);
    this.setState({
      activeId:data
    })
  };
  render() {
    return (
      <div className="App">
        <Header numbers={this.state.navItems} activeId={this.state.activeId} setHeader={this.setHeader} />
        <Body />
      </div>
    );
  }
}

export default App;
